object Solution {
  val mod: Int = 1e9.toInt + 7

  def count(num1: String, num2: String, min_sum: Int, max_sum: Int): Int = {
    val dp = Array.ofDim[Int](num2.length + 1, max_sum + 1, 2)
    for(i <- dp.indices) {
      for(j <- dp(i).indices) {
        java.util.Arrays.fill(dp(i)(j), -1)
      }
    }

    def digitSum(x: Int): Int = if (x == 0) 0 else x % 10 + digitSum(x / 10)

    def dfs(pos: Int, sum: Int, limit: Boolean, isZero: Boolean, num: String): Int = {
      if (sum > max_sum) return 0
      if (pos == num.length) {
        if (sum >= min_sum && sum <= max_sum) return 1
        else return 0
      }
      if (!limit && !isZero && dp(pos)(sum)(1) != -1) return dp(pos)(sum)(1)
      val up = if (limit) num(pos) - '0' else 9
      var ans = 0
      for (d <- 0 to up) {
        ans = (ans + dfs(pos + 1, if (isZero && d == 0) 0 else sum + d, limit && d == up, isZero && d == 0, num)) % mod
      }
      if (!limit && !isZero) dp(pos)(sum)(1) = ans
      ans
    }

    def solve(num: String): Int = dfs(0, 0, limit = true, isZero = true, num)

    val a = solve(num2)
    val b = solve((BigInt(num1) - 1).toString)
    (a - b + mod) % mod
  }
}
